import axios from 'axios';
import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { getAllusers } from '../redux/userSlice';
import UserdetailsTable from './UserdetailsTable';

function UsersList() {
    const dispatch = useDispatch();
    const users = useSelector((state) => state?.users?.users ?? []);

    useEffect(() => {
        const fetchUsers = async () => {
            try {
                const res = await axios.get(`http://localhost:5000/users`, { withCredentials: true });
                if (res.data) {
                    dispatch(getAllusers(res?.data?.allUsers ?? []));
                }
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        }
        fetchUsers();
    }, []);

    return (
        <div className='usersList'>
            <table className='users-table'>
                <thead>
                    <tr>
                        <th>User Name</th>
                        <th>Email</th>
                        <th colSpan={2}>Status</th>
                        <th>Remove</th>
                    </tr>
                </thead>
                <tbody>
                    {users && users.map((element, index) => (
                        <UserdetailsTable key={index} userName={element.userName} email={element.email} userId={element._id} />
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default UsersList;

           
